def fact(n):
    if n==0:
        return 1
    else:
        return n*fact(n-1)

class Person:
    def __init__(self, name):
        self.name = name
    def greet(self):
        return f'Hi, I am {self.name}'

try:
    result = 10 / 0
except ZeroDivisionError:
    print('Cannot divide by zero')

def fib(n):
    a, b = 0, 1
    for _ in range(n):
        a, b = b, a + b
    return a

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5)+1):
        if n % i == 0:
            return False
    return True
